import React from "react";
import { Button } from "reactstrap";
import ConferenceBoxHead from "./ConferenceBoxHead";

const ConferenceBox: React.FC = () => {
  return (
    <div className="w-100 vh-100">
      <ConferenceBoxHead />
      <div
        className="w-100"
        style={{
          height: "calc(100% - 79px)",
          backgroundColor: "#c1c1c1",
          position: "relative",
        }}
      >
        <div
          className="w-100 d-flex justify-content-center align-align-items-center"
          style={{ position: "absolute", bottom: "50px" }}
        >
          <>
            <li className="list-inline-item d-none d-lg-inline-block">
              <Button
                type="button"
                color="none"
                onClick={() => {}}
                className={`nav-btn user-profile-show btn-head-conference ${
                  true ? "red" : "white"
                }`}
              >
                {false ? (
                  <i className="ri-mic-line"></i>
                ) : (
                  <i className="ri-mic-off-line"></i>
                )}
              </Button>
            </li>

            <li className="list-inline-item d-none d-lg-inline-block">
              <Button
                type="button"
                color="none"
                onClick={() => {}}
                className={`nav-btn user-profile-show btn-head-conference ${
                  false ? "red" : "white"
                }`}
              >
                {false ? (
                  <i className="ri-play-line"></i>
                ) : (
                  <i className="ri-pause-line"></i>
                )}
              </Button>
            </li>

            <li className="list-inline-item d-none d-lg-inline-block">
              <Button
                type="button"
                color="none"
                onClick={() => {}}
                className={`nav-btn user-profile-show btn-head-conference white ${
                  false ? "red" : "white"
                }`}
              >
                {false ? (
                  <i className="ri-camera-off-line"></i>
                ) : (
                  <i className="ri-camera-line"></i>
                )}
              </Button>
            </li>

            <li className="list-inline-item d-none d-lg-inline-block">
              <Button
                type="button"
                color="none"
                onClick={() => {}}
                className={`nav-btn user-profile-show btn-head-conference white ${
                  false ? "red" : "white"
                }`}
              >
                {false ? (
                  <i className="ri-window-off-line"></i>
                ) : (
                  <i className="ri-window-line"></i>
                )}
              </Button>
            </li>

            <li className="list-inline-item d-none d-lg-inline-block">
              <Button
                type="button"
                color="none"
                onClick={() => {}}
                className={`nav-btn user-profile-show btn-head-conference white ${
                  false ? "red" : "white"
                }`}
              >
                {false ? (
                  <i className="ri-chat-1-off-line"></i>
                ) : (
                  <i className="ri-chat-1-line"></i>
                )}
              </Button>
            </li>
          </>
        </div>
      </div>
    </div>
  );
};

export default ConferenceBox;
